import React, {Fragment} from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Login from './paginas/auth/Login';
import CrearLogin from './paginas/auth/CrearLogin';

function App() {

  return (
    <Fragment>
      <Router>
        <Routes>
          <Route path="/" exact element = {<Login/>}/>;
          <Route path="/crear-login" exact element = {<CrearLogin/>}/>;
         </Routes>
      </Router>
    </Fragment>
  );
}
export default App;
